const GroceryListItem = ({item}) => {

    return (
    <div className='grocery_list'>
        <div className='grocery_item_detail'>
            <div>
            <button>X</button> </div>
            <p>{item.name}</p>
            <p>{item.count}</p>
        </div>
        <div>         
            <img src={item.image} alt=''></img>
        </div>
    </div>
)
}

export default GroceryListItem;
